import initial from './initialState';

const reducer = (state = initial, action) => {

    switch (action.type) {

        case "SET_DASHBOARD" : {
            //console.log("Payload " + action.payload.status + action.payload.data.user_id)

            if(action.payload.status===200)
			{
                console.log("reducer fired " + typeof action.payload.data)

                return {...state,
                            isLogged:true,
                            course_list:action.payload.data.course_details
                            // user_id:action.payload.data.course_details.user_id,
                            // course_id: action.payload.data.course_details.course_id,
                            // course_name: action.payload.data.course_details.course_name,
                            // course_term: action.payload.data.course_details.course_term
                       };
			}
			else
			{
				console.log('REDUCER ISVALID ' + action.payload);
				return {...state};	
			}	

		}

        default :
            return state;
    }
};

export default reducer;
